static void
MHD_connection_update_event_loop_info (struct MHD_Connection *connection)
{
  /* Minimal probe: log entry and key connection fields to help reproduce reachability */
  {
    FILE *log = fopen("/tmp/logs/3676.txt", "a");
    if (log)
    {
      fprintf (log, "ENTER: MHD_connection_update_event_loop_info connection=%p suspended=%d tls_state=%d state=%d read_buf_off=%u read_buf_size=%u\n",
               (void *)connection,
               (int)(connection ? connection->suspended : 0),
               (int)(connection ? connection->tls_state : -1),
               (int)(connection ? connection->state : -1),
               (unsigned int)(connection ? connection->read_buffer_offset : 0U),
               (unsigned int)(connection ? connection->read_buffer_size : 0U));
      fclose (log);
    }
  }

  /* Do not update states of suspended connection */
  if (connection->suspended)
    return; /* States will be updated after resume. */
#ifdef HTTPS_SUPPORT
  if (MHD_TLS_CONN_NO_TLS != connection->tls_state)
  {   /* HTTPS connection. */
    /* Log entering TLS-handling switch and the tls_state value */
    {
      FILE *log = fopen("/tmp/logs/3676.txt", "a");
      if (log)
      {
        fprintf (log, "TLS-BRANCH: tls_state=%d connection=%p\n",
                 (int)connection->tls_state, (void *)connection);
        fclose (log);
      }
    }

    switch (connection->tls_state)
    {
    case MHD_TLS_CONN_INIT:
      {
        FILE *log = fopen("/tmp/logs/3676.txt", "a");
        if (log)
        {
          fprintf (log, "TLS-CASE: INIT -> set event_loop_info=READ for connection=%p\n", (void *)connection);
          fclose (log);
        }
      }
      connection->event_loop_info = MHD_EVENT_LOOP_INFO_READ;
      return;
    case MHD_TLS_CONN_HANDSHAKING:
    case MHD_TLS_CONN_WR_CLOSING:
      {
        int dir = gnutls_record_get_direction (connection->tls_session);
        FILE *log = fopen("/tmp/logs/3676.txt", "a");
        if (log)
        {
          fprintf (log, "TLS-CASE: HANDSHAKING/WR_CLOSING -> gnutls dir=%d connection=%p\n", dir, (void *)connection);
          fclose (log);
        }
        if (0 == dir)
          connection->event_loop_info = MHD_EVENT_LOOP_INFO_READ;
        else
          connection->event_loop_info = MHD_EVENT_LOOP_INFO_WRITE;
      }
      return;
    case MHD_TLS_CONN_CONNECTED:
      {
        FILE *log = fopen("/tmp/logs/3676.txt", "a");
        if (log)
        {
          fprintf (log, "TLS-CASE: CONNECTED -> fallthrough to normal processing connection=%p\n", (void *)connection);
          fclose (log);
        }
      }
      break; /* Do normal processing */
    case MHD_TLS_CONN_WR_CLOSED:
    case MHD_TLS_CONN_TLS_FAILED:
      {
        FILE *log = fopen("/tmp/logs/3676.txt", "a");
        if (log)
        {
          fprintf (log, "TLS-CASE: WR_CLOSED/TLS_FAILED -> set event_loop_info=CLEANUP connection=%p\n", (void *)connection);
          fclose (log);
        }
      }
      connection->event_loop_info = MHD_EVENT_LOOP_INFO_CLEANUP;
      return;
    case MHD_TLS_CONN_TLS_CLOSING:  /* Not implemented yet */
    case MHD_TLS_CONN_TLS_CLOSED:   /* Not implemented yet */
    case MHD_TLS_CONN_INVALID_STATE:
    case MHD_TLS_CONN_NO_TLS: /* Not possible */
    default:
      {
        FILE *log = fopen("/tmp/logs/3676.txt", "a");
        if (log)
        {
          fprintf (log, "TLS-CASE: INVALID/UNEXPECTED VALUE tls_state=%d connection=%p -> PANIC\n",
                   (int)connection->tls_state, (void *)connection);
          fclose (log);
        }
      }
      MHD_PANIC (_ ("Invalid TLS state value.\n"));
    }
  }
#endif /* HTTPS_SUPPORT */
  while (1)
  {
#if DEBUG_STATES
    MHD_DLOG (connection->daemon,
              _ ("In function %s handling connection at state: %s\n"),
              MHD_FUNC_,
              MHD_state_to_string (connection->state));
#endif
    /* Log about to evaluate state switch */
    {
      FILE *log = fopen("/tmp/logs/3676.txt", "a");
      if (log)
      {
        fprintf (log, "STATE-SWITCH: connection=%p current_state=%d\n", (void *)connection, (int)connection->state);
        fclose (log);
      }
    }

    switch (connection->state)
    {
    case MHD_CONNECTION_INIT:
    case MHD_CONNECTION_REQ_LINE_RECEIVING:
      {
        FILE *log = fopen("/tmp/logs/3676.txt", "a");
        if (log)
        {
          fprintf (log, "STATE-CASE: RECV-LINE -> set event_loop_info=READ connection=%p\n", (void *)connection);
          fclose (log);
        }
      }
      connection->event_loop_info = MHD_EVENT_LOOP_INFO_READ;
      break;
    case MHD_CONNECTION_REQ_LINE_RECEIVED:
      {
        FILE *log = fopen("/tmp/logs/3676.txt", "a");
        if (log)
        {
          fprintf (log, "STATE-CASE: REQ_LINE_RECEIVED -> assert(0) connection=%p\n", (void *)connection);
          fclose (log);
        }
      }
      mhd_assert (0);
      break;
    case MHD_CONNECTION_REQ_HEADERS_RECEIVING:
      {
        FILE *log = fopen("/tmp/logs/3676.txt", "a");
        if (log)
        {
          fprintf (log, "STATE-CASE: REQ_HEADERS_RECEIVING -> set event_loop_info=READ connection=%p\n", (void *)connection);
          fclose (log);
        }
      }
      connection->event_loop_info = MHD_EVENT_LOOP_INFO_READ;
      break;
    case MHD_CONNECTION_HEADERS_RECEIVED:
    case MHD_CONNECTION_HEADERS_PROCESSED:
      {
        FILE *log = fopen("/tmp/logs/3676.txt", "a");
        if (log)
        {
          fprintf (log, "STATE-CASE: HEADERS_RECEIVED/PROCESSED -> assert(0) connection=%p\n", (void *)connection);
          fclose (log);
        }
      }
      mhd_assert (0);
      break;
    case MHD_CONNECTION_CONTINUE_SENDING:
      {
        FILE *log = fopen("/tmp/logs/3676.txt", "a");
        if (log)
        {
          fprintf (log, "STATE-CASE: CONTINUE_SENDING -> set event_loop_info=WRITE connection=%p\n", (void *)connection);
          fclose (log);
        }
      }
      connection->event_loop_info = MHD_EVENT_LOOP_INFO_WRITE;
      break;
    case MHD_CONNECTION_BODY_RECEIVING:
      {
        FILE *log = fopen("/tmp/logs/3676.txt", "a");
        if (log)
        {
          fprintf (log, "STATE-CASE: BODY_RECEIVING -> some_payload_processed=%d have_chunked=%d remaining_upload_size=%zu read_buffer_offset=%u\n",
                   (int)connection->rq.some_payload_processed,
                   (int)connection->rq.have_chunked_upload,
                   connection->rq.remaining_upload_size,
                   (unsigned int)connection->read_buffer_offset);
          fclose (log);
        }
      }
      if ((connection->rq.some_payload_processed) &&
          has_unprocessed_upload_body_data_in_buffer (connection))
      {
        /* Some data was processed, the buffer must have some free space */
        mhd_assert (connection->read_buffer_offset < \
                    connection->read_buffer_size);
        if (! connection->rq.have_chunked_upload)
        {
          /* Not a chunked upload. Do not read more than necessary to
             process the current request. */
          if (connection->rq.remaining_upload_size >=
              connection->read_buffer_offset)
            connection->event_loop_info = MHD_EVENT_LOOP_INFO_PROCESS;
          else
            connection->event_loop_info = MHD_EVENT_LOOP_INFO_PROCESS_READ;
        }
        else
        {
          /* Chunked upload. The size of the current request is unknown.
             Continue reading as the space in the read buffer is available. */
          connection->event_loop_info = MHD_EVENT_LOOP_INFO_PROCESS_READ;
        }
      }
      else
        connection->event_loop_info = MHD_EVENT_LOOP_INFO_READ;
      break;
    case MHD_CONNECTION_BODY_RECEIVED:
      {
        FILE *log = fopen("/tmp/logs/3676.txt", "a");
        if (log)
        {
          fprintf (log, "STATE-CASE: BODY_RECEIVED -> assert(0) connection=%p\n", (void *)connection);
          fclose (log);
        }
      }
      mhd_assert (0);
      break;
    case MHD_CONNECTION_FOOTERS_RECEIVING:
      {
        FILE *log = fopen("/tmp/logs/3676.txt", "a");
        if (log)
        {
          fprintf (log, "STATE-CASE: FOOTERS_RECEIVING -> set event_loop_info=READ connection=%p\n", (void *)connection);
          fclose (log);
        }
      }
      connection->event_loop_info = MHD_EVENT_LOOP_INFO_READ;
      break;
    case MHD_CONNECTION_FOOTERS_RECEIVED:
      {
        FILE *log = fopen("/tmp/logs/3676.txt", "a");
        if (log)
        {
          fprintf (log, "STATE-CASE: FOOTERS_RECEIVED -> assert(0) connection=%p\n", (void *)connection);
          fclose (log);
        }
      }
      mhd_assert (0);
      break;
    case MHD_CONNECTION_FULL_REQ_RECEIVED:
      {
        FILE *log = fopen("/tmp/logs/3676.txt", "a");
        if (log)
        {
          fprintf (log, "STATE-CASE: FULL_REQ_RECEIVED -> set event_loop_info=PROCESS connection=%p\n", (void *)connection);
          fclose (log);
        }
      }
      connection->event_loop_info = MHD_EVENT_LOOP_INFO_PROCESS;
      break;
    case MHD_CONNECTION_START_REPLY:
      {
        FILE *log = fopen("/tmp/logs/3676.txt", "a");
        if (log)
        {
          fprintf (log, "STATE-CASE: START_REPLY -> assert(0) connection=%p\n", (void *)connection);
          fclose (log);
        }
      }
      mhd_assert (0);
      break;
    case MHD_CONNECTION_HEADERS_SENDING:
      {
        FILE *log = fopen("/tmp/logs/3676.txt", "a");
        if (log)
        {
          fprintf (log, "STATE-CASE: HEADERS_SENDING -> set event_loop_info=WRITE connection=%p\n", (void *)connection);
          fclose (log);
        }
      }
      /* headers in buffer, keep writing */
      connection->event_loop_info = MHD_EVENT_LOOP_INFO_WRITE;
      break;
    case MHD_CONNECTION_HEADERS_SENT:
      {
        FILE *log = fopen("/tmp/logs/3676.txt", "a");
        if (log)
        {
          fprintf (log, "STATE-CASE: HEADERS_SENT -> assert(0) connection=%p\n", (void *)connection);
          fclose (log);
        }
      }
      mhd_assert (0);
      break;
    case MHD_CONNECTION_NORMAL_BODY_UNREADY:
      connection->event_loop_info = MHD_EVENT_LOOP_INFO_PROCESS;
      break;
    case MHD_CONNECTION_NORMAL_BODY_READY:
      connection->event_loop_info = MHD_EVENT_LOOP_INFO_WRITE;
      break;
    case MHD_CONNECTION_CHUNKED_BODY_UNREADY:
      connection->event_loop_info = MHD_EVENT_LOOP_INFO_PROCESS;
      break;
    case MHD_CONNECTION_CHUNKED_BODY_READY:
      connection->event_loop_info = MHD_EVENT_LOOP_INFO_WRITE;
      break;
    case MHD_CONNECTION_CHUNKED_BODY_SENT:
      mhd_assert (0);
      break;
    case MHD_CONNECTION_FOOTERS_SENDING:
      connection->event_loop_info = MHD_EVENT_LOOP_INFO_WRITE;
      break;
    case MHD_CONNECTION_FULL_REPLY_SENT:
      mhd_assert (0);
      break;
    case MHD_CONNECTION_CLOSED:
      {
        FILE *log = fopen("/tmp/logs/3676.txt", "a");
        if (log)
        {
          fprintf (log, "STATE-CASE: CLOSED -> set event_loop_info=CLEANUP and return connection=%p\n", (void *)connection);
          fclose (log);
        }
      }
      connection->event_loop_info = MHD_EVENT_LOOP_INFO_CLEANUP;
      return;           /* do nothing, not even reading */
#ifdef UPGRADE_SUPPORT
    case MHD_CONNECTION_UPGRADE:
      mhd_assert (0);
      break;
#endif /* UPGRADE_SUPPORT */
    default:
      mhd_assert (0);
    }

    if (0 != (MHD_EVENT_LOOP_INFO_READ & connection->event_loop_info))
    {
      /* Check whether the space is available to receive data */
      if (! check_and_grow_read_buffer_space (connection))
      {
        FILE *log = fopen("/tmp/logs/3676.txt", "a");
        if (log)
        {
          fprintf (log, "BUFFER-GROW: failed -> discard_request=%d connection=%p\n",
                   (int)connection->discard_request, (void *)connection);
          fclose (log);
        }
        mhd_assert (connection->discard_request);
        continue;
      }
    }
    break; /* Everything was processed. */
  }
}
